import React from 'react';

export default function HomePage() {
	return (
		<div>
			<h1>Wok on NEXT</h1>
			<img src="http://www.wok88.se/logotype.png" alt="drag-on" />
			<ul>
				<li>Hem</li>
				<li>Lunchmeny</li>
				<li>A la carte</li>
				<li>Contact Us</li>
			</ul>

			<a href="/lunchmenu">Lunch</a>
			<button>Button</button>
			<a class="button">Link</a>
			<button>press</button>
			<style global jsx>{`
				body {
					background: #fffff0;
				}
			`}</style>
		</div>
	);
}

// #e30613 header color
